Strap on your seat belt! Here\'s rollicking      
fun with Baloo Bear and his cargo plane the     
Mini-Sea Duck. He\'s out delivering goods to     
all the people in the cape. But Don Karnage     
and his goofy band of pirates are hot on        
Baloo\'s tail wind, trying to swipe the cargo!   
It\'s high-flying adventures as Baloo dodges     
and shoots through the clouds and over          
skycrapers. It\'s low-flying fun as he zips      
through a haunted house where hats and gloves   
